import random

class Solution:
    def highFive(self, items):
        d = defaultdict(list)
        m = 0
        for i, x in items:
            d[i].append(x)
            m = max(m, i)
        ans = []
        for i in range(1, m + 1):
            if xs := d[i]:
                avg = sum(nlargest(5, xs)) // 5
                ans.append([i, avg])
        return ans

def generate_test_case():
    solution = Solution()

    # Generate random student scores
    items = []
    num_students = random.randint(1, 10) # Number of students in a test case
    for _ in range(1, num_students+1):
        student_id = random.randint(1, 1000)
        scores = random.sample(range(0, 101), 10) # Assuming each student has 10 scores
        for score in scores:
            items.append([student_id, score])

    # Calculate the expected result using the provided Solution class
    expected_result = solution.highFive(items)

    return items, expected_result

def test_generated_test_cases(num_tests):
    test_case_generator_results = []
    for i in range(num_tests):
        items, expected_result = generate_test_case()
        solution = Solution()
        assert solution.highFive(items) == expected_result
        if len(expected_result) != 0:
            print(f"assert solution.highFive({items}) == {expected_result}")
            test_case_generator_results.append(f"assert solution.highFive({items}) == {expected_result}")
    return test_case_generator_results

if __name__ == "__main__":
    num_tests = 100
    test_case_generator_results = test_generated_test_cases(num_tests)

inefficient_solution:
class Solution:
    def highFive(self, items: List[List[int]]) -> List[List[int]]:
        d = {}
        m = 0
        for i, x in items:
            if i not in d:
                d[i] = [x]
            else:
                d[i].append(x)
            m = max(m, i)

        ans = []
        for i in range(1, m + 1):
            if i not in d:
                continue
            xs = d[i]
            xs.sort(reverse=True)
            avg = sum(xs[:5]) // 5
            ans.append([i, avg])

        ans.sort(key=lambda x: x[0])
        return ans
